window.bookSummaryJSON = "<p><b>\"Few audiobooks warrant turning off all distractions, closing one's eyes, and simply listening to the story unfold. Narrator Caitlin Davies creates just that experience as she passionately guides listeners through this gripping story of ambition, love, and desire.\" (</b><b><i>AudioFile Magazine</i></b><b>)</b></p> <p><b>Tricia Levenseller, author of </b><b><i>Daughter of the Pirate King</i></b><b>, is back with an epic YA tale of ambition and love in </b><b><i>The Shadows Between Us</i></b><b>....</b></p> <p><i>\"They’ve never found the body of the first and only boy who broke my heart. And they never will.\"</i></p> <p>Alessandra is tired of being overlooked, but she has a plan to gain power:</p> <p></p> <ol> <li>Woo the Shadow King.</li> <li>Marry him.</li> <li>Kill him and take his kingdom for herself.</li> </ol> <p>No one knows the extent of the freshly crowned Shadow King’s power. Some say he can command the shadows that swirl around him to do his bidding. Others say they speak to him, whispering the thoughts of his enemies. Regardless, Alessandra knows what she deserves, and she’s going to do everything within her power to get it.</p> <p>But Alessandra’s not the only one trying to kill the king. As attempts on his life are made, she finds herself trying to keep him alive long enough for him to make her his queen - all while struggling not to lose her heart. After all, who better for a Shadow King than a cunning, villainous queen?</p> <p><b>A Macmillan Audio production from Feiwel &amp; Friends</b></p> <p>\"Tricia Levenseller’s latest, <i>The Shadows Between Us</i>, is a decadent and wickedly addictive fantasy, full of schemes and court intrigue, and delightful descriptions of food, which I am always a fan of.\" (Kendare Blake, number-one <i>New York Times</i> best-selling author of the Three Dark Crowns series)</p>"; 
